def get_odd_collatz(n):
    sequence = [n]
    current = n

    while current != 1:
        if current % 2 == 0:
            current = current // 2
        else:
            current = 3 * current + 1
        sequence.append(current)

    odd_numbers = [num for num in sequence if num % 2 == 1]
    return sorted(odd_numbers)

def valid_date(date):
    if not date:
        return False

    if len(date) != 10:
        return False

    if date[2] != '-' or date[5] != '-':
        return False

    try:
        month = int(date[0:2])
        day = int(date[3:5])
        year = int(date[6:10])
    except ValueError:
        return False

    if month < 1 or month > 12:
        return False

    if month in [1, 3, 5, 7, 8, 10, 12]:
        if day < 1 or day > 31:
            return False
    elif month in [4, 6, 9, 11]:
        if day < 1 or day > 30:
            return False
    elif month == 2:
        if day < 1 or day > 29:
            return False

    return True

