    has_nested = False

    for char in string:
        if char == '[':
            if stack and stack[-1] == '[':
                has_nested = True
            stack.append(char)
        elif char == ']':
            if stack and stack[-1] == '[':
                stack.pop()

    return has_nested and len(stack) == 0

