def parse_nested_parens(paren_string: str) -> List[int]:
    result = []
    current_depth = 0
    max_depth = 0

    for char in paren_string:
        if char == '(':
            current_depth += 1
            if current_depth > max_depth:
                max_depth = current_depth
        elif char == ')':
            current_depth -= 1
        elif char == ' ':
            if max_depth > 0:
                result.append(max_depth)
                max_depth = 0
                current_depth = 0

    if max_depth > 0:
        result.append(max_depth)

    return result

