import math

def poly(xs, x):
    return sum([coeff * math.pow(x, i) for i, coeff in enumerate(xs)])

def find_zero(xs):
    n = len(xs) - 1
    a = xs[-1]
    b = xs[-2]

    if n == 1:
        return -xs[0] / xs[1]

    x0 = -b / (a * n)

    def f(x):
        return poly(xs, x)

    def df(x):
        return sum([i * coeff * math.pow(x, i-1) for i, coeff in enumerate(xs) if i > 0])

    x = x0
    for _ in range(100):
        fx = f(x)
        if abs(fx) < 1e-10:
            return x
        dfx = df(x)
        if abs(dfx) < 1e-10:
            break
        x = x - fx / dfx

    return x

