def modp(n: int, p: int):
    if n == 0:
        return 1
    result = 1
    base = 2 % p
    exponent = n
    while exponent > 0:
        if exponent % 2 == 1:
            result = (result * base) % p
        base = (base * base) % p
        exponent //= 2
    return result

