    def calculate(k):
        if k in memo:
            return memo[k]
        if k == 1:
            result = 3
        elif k % 2 == 0:
            result = 1 + k // 2
        else:
            result = calculate(k - 1) + calculate(k - 2) + calculate(k + 1)
        memo[k] = result
        return result

    result = []
    for i in range(1, n + 2):
        result.append(calculate(i))

    return result

