    b = xs[-2]

    if n == 1:
        return -xs[0] / xs[1]

    x0 = -b / (a * n)

    def f(x):
        return poly(xs, x)

    def df(x):
        return sum([i * coeff * math.pow(x, i-1) for i, coeff in enumerate(xs) if i > 0])

    x = x0
    for _ in range(100):
        fx = f(x)
