def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2

    start_max = max(start1, start2)
    end_min = min(end1, end2)

    if start_max > end_min:
        return "NO"

    length = end_min - start_max

    if length < 2:
        return "NO"

    for i in range(2, int(length**0.5) + 1):
        if length % i == 0:
            return "NO"

    return "YES"

def prod_signs(arr):
    if not arr:
        return None
    product_of_signs = 1
    sum_of_magnitudes = 0
    for num in arr:
        if num > 0:
            sign = 1
        elif num < 0:
            sign = -1
        else:
            sign = 0
        product_of_signs *= sign
        sum_of_magnitudes += abs(num)
    return product_of_signs * sum_of_magnitudes

def minPath(grid, k):
    n = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def get_neighbors(i, j):
        neighbors = []
        for dx, dy in directions:
            ni, nj = i + dx, j + dy
            if 0 <= ni < n and 0 <= nj < n:
                neighbors.append((ni, nj))
        return neighbors

    min_path = None

    for i in range(n):
        for j in range(n):
            stack = [(i, j, [grid[i][j]])]
            while stack:
                x, y, path = stack.pop()
                if len(path) == k:
                    if min_path is None or path < min_path:
                        min_path = path
                    continue
                for nx, ny in get_neighbors(x, y):
                    new_path = path + [grid[nx][ny]]
                    stack.append((nx, ny, new_path))

    return min_path

def tri(n):
    if n < 0:
        return []

    memo = {}

    def calculate(k):
        if k in memo:
            return memo[k]
        if k == 1:
            result = 3
        elif k % 2 == 0:
            result = 1 + k // 2
        else:
            result = calculate(k - 1) + calculate(k - 2) + calculate(k + 1)
        memo[k] = result
        return result

    result = []
    for i in range(1, n + 2):
        result.append(calculate(i))

    return result

def digits(n):
    product = 1
    has_odd = False
    for digit in str(n):
        d = int(digit)
        if d % 2 != 0:
            product *= d
            has_odd = True
    return product if has_odd else 0

def is_nested(string):
    stack = []
    has_nested = False

    for char in string:
        if char == '[':
            if stack and stack[-1] == '[':
                has_nested = True
            stack.append(char)
        elif char == ']':
            if stack and stack[-1] == '[':
                stack.pop()

    return has_nested and len(stack) == 0

