def fix_spaces(text):
    result = []
    space_count = 0

    for char in text:
        if char == ' ':
            space_count += 1
        else:
            if space_count > 0:
                if space_count > 2:
                    result.append('-')
                else:
                    result.append('_' * space_count)
                space_count = 0
            result.append(char)

    if space_count > 0:
        if space_count > 2:
            result.append('-')
        else:
            result.append('_' * space_count)

    return ''.join(result)

def file_name_check(file_name):
    if file_name.count('.') != 1:
        return 'No'

    parts = file_name.split('.')
    name_part = parts[0]
    ext_part = parts[1]

    if not name_part:
        return 'No'

    if not name_part[0].isalpha():
        return 'No'

    digit_count = sum(1 for char in name_part if char.isdigit())
    if digit_count > 3:
        return 'No'

    valid_extensions = ['txt', 'exe', 'dll']
    if ext_part not in valid_extensions:
        return 'No'

    return 'Yes'

